import { dbs_15, racks_15, dbRackConnections, workdesks_15 } from "../components/Layout/floor15_layout";
import LapMap from "../components/Map/LapMap";
function Floor15(){
    return(
        <div>
            <LapMap 
                floorId={15}
                dbs={dbs_15}
                racks={racks_15}
                tables={workdesks_15}

            />
        </div>
    );
}

export default Floor15;
